import React from "react";
import { Link } from "react-router-dom";

import "./navbar.css";

const Navbar = () => {
  return (
    <div className="cont">
      <ul className="containee">
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/getrecommandation">Get Recommandations</Link>
        </li>
        <li>
          {" "}
          <Link to="/detection">Detection</Link>
        </li>
        <li>
          {" "}
          <Link to="/inventory">Inventory</Link>
        </li>
      </ul>
    </div>
  );
};

export default Navbar;
